import React from 'react'
import './App.css'

export default class Nav extends Component {
    render() {
        return(
            <nav className='navbar'>
                <a href='#'>Home</a>
                <a href='#'>About</a>
                <a href='#'>Products</a>
                <a href='#'>Contact</a>
            </nav>
        );
    }
}
